const routes = [
  {
    path: ["/", "/home"],
    exact: true,
    component: "Home",
  },
  {
    path: "/food",
    exact: true,
    component: "Food",
  },
  {
    path: "/whatson",
    exact: true,
    component: "UnderConstruction",
  },
  {
    path: "/livemusic",
    exact: true,
    component: "UnderConstruction",
  },
  {
    path: "/gallery",
    exact: true,
    component: "UnderConstruction",
  }
];

export default routes;
